import React from 'react'
import {Avatar} from "@material-ui/core"
import "./Sidebar.css"
import SidebarGroup from "./SidebarGroup"
import SidebarOptions from "./SidebarOptions"
import HomeIcon from '@material-ui/icons/Home';
import SearchIcon from '@material-ui/icons/Search';
import FavoriteIcon from '@material-ui/icons/Favorite';
import PlaylistPlayIcon from '@material-ui/icons/PlaylistPlay';
import PersonIcon from '@material-ui/icons/Person';
import StarIcon from '@material-ui/icons/Star';

function Sidebar() {
    return (
        <div className="sidebar">
            <Avatar className="sidebar-avatar"/>
            <div className="sidebar-group">
                <SidebarGroup title="DISCOVER" />
                <SidebarOptions Icon={HomeIcon} title="Home" />
                <SidebarOptions Icon={SearchIcon} title="Browse" />
                <SidebarOptions Icon={FavoriteIcon} title="For you" />
            </div>
            <div className="sidebar-group">
                <SidebarGroup title="LIBRARY" />
                <SidebarOptions Icon={PlaylistPlayIcon} title="Project" />
                <SidebarOptions Icon={PersonIcon} title="Authors" />
                <SidebarOptions Icon={StarIcon} title="Favorites" />
            </div>
        </div>
    )
}

export default Sidebar
